const Menu = ({isActive, setIsActive}) => {
    const [isExperienceHovered, setIsExperienceHovered] = useState(false);
    const [isProjectsHovered, setIsProjectseHovered] = useState(false);
    const [isAboutHovered, setIsAboutHovered] = useState(false);

    const variants= {
        open: {
            width: "fit-content",
            height: "4rem",
            opacity: 1,
            right: "-2.5px",
            y: "-0.5rem",
            transition: { duration: 0.85, type: "tween", ease: [0.76, 0, 0.24, 1]},
            zIndex: 15,
            display: "block",
            pointerEvents: "auto"
        },
        closed: {
            opacity: 0,
            width: "100px",
            height: "40px",
            y: "-0.5rem",
            zIndex: 0,
            transition: { duration: 0.85, delay: 0.35, type: "tween", ease: [0.76, 0, 0.24, 1]},
            pointerEvents: "none"
        }
    };

    return (
        <motion.div
            className="bg-white rounded-lg absolute top-5"
            variants={variants}
            animate={isActive ? "open" : "closed"}
            initial="closed"
        >
            <div className="flex items-center gap-x-[1.5rem] pl-[1rem] pr-[8rem] h-full uppercase text-[1.5rem] font-semibold">
                <Link
                    onClick={() => setIsActive(false)}
                    onMouseEnter={() => setIsExperienceHovered(true)}
                    onMouseLeave={() => setIsExperienceHovered(false)}
                    style={{textDecorationLine: (isExperienceHovered ? "underline": "none"), textDecorationColor: "#f5c63f", textDecorationThickness: "0.3rem"}}
                    href="#experience"
                >
                    Experience
                </Link>
                <Link
                    onClick={() => setIsActive(false)}
                    onMouseEnter={() => setIsProjectseHovered(true)}
                    onMouseLeave={() => setIsProjectseHovered(false)}
                    style={{textDecorationLine: (isProjectsHovered ? "underline": "none"), textDecorationColor: "#356fdb", textDecorationThickness: "0.3rem"}}
                    href="#projects"
                >
                    Projects
                </Link>
                <Link
                    onClick={() => setIsActive(false)}
                    onMouseEnter={() => setIsAboutHovered(true)}
                    onMouseLeave={() => setIsAboutHovered(false)}
                    style={{textDecorationLine: (isAboutHovered ? "underline": "none"), textDecorationColor: "#c32d27", textDecorationThickness: "0.3rem"}}
                    href="#about"
                >
                    About
                </Link>
            </div>
        </motion.div>
    )
}

const MenuButton = ({isActive, setIsActive}) => {

    return(
        <div className="absolute right-2 top-5 cursor-pointer w-[6rem] h-[3rem] overflow-hidden">
            <motion.div
                className="w-full h-full relative"
                animate={{top: isActive ? "-100%" : "0%"}}
                transition={{duration: 0.5, delay: 0.5 , type: "tween", ease: [0.76, 0, 0.24, 1]}}
            >
                <GsapMagnetic>
                <div
                    className="w-full h-full rounded-lg  flex items-center justify-center"
                    onClick={() => setIsActive(true)}
                >
                    <p className="text-white font-semibold text-[1.5rem] uppercase m-0">Menu</p>
                </div>
                </GsapMagnetic>
                <div
                    className="w-full h-full bg-[#222222] rounded-lg z-[20] flex items-center justify-center relative"
                    onClick={() => setIsActive(false)}
                >
                    <p className="text-white font-semibold text-[1.5rem] uppercase m-0">Close</p>
                </div>
            </motion.div>
        </div>
    )
}